import React, { useState } from 'react';
import { useAppDispatch } from '../../redux/hooks/hooks';
import {searchFrends} from '../../redux/features/FrendsList/FrendsSlice';
import styles from './SearchForm.module.scss';
type FormProps ={
    onSubmit:React.FormEventHandler<HTMLFormElement>
}
function SearchForm ({onSubmit}:FormProps){
    const [valueInput, setValueInput]=useState('');
    const dispatch=useAppDispatch();
   
   const handleSubmit=dispatch(searchFrends(valueInput))
return(
<form onSubmit={handleSubmit} className={styles.block__form}>
    <label>Найти друзей:
        <input type='text' placeholder='Найти' value={valueInput} onChange={event=>setValueInput(event.target.value)}/>
        <button type='submit'>Найти</button>
    </label>
    </form>
   

)
}
export default SearchForm;
